column8:
アミノ酸・ビタミン・ミネラル・酵素を豊富に含む海藻（アルグ）をベースに作られた<BR>界面活性剤・油分・防腐剤を一切使用しない、無乳化のパック。<BR>そのまま肌にのばし、しばらくおいた後、洗い流すタイプです。<BR>余分な皮脂を浮き上がらせ、肌のキメを整えて、なめらかにします。<BR>
<BR>
内容量：150g<BR>
<BR>
◆使い方◆<BR>
アルグ3g（ティースプーンに軽く1杯分）を手にとって
洗顔後の濡れたお肌にのばします。<BR>
パックが乾かないように湯船に浸かりながら海藻の成分が<BR>
じんわりとしみわたるまで7～10分おきます。<BR>
その後、ぬるま湯でていねいに洗い流してください。<BR>


